import React from 'react';
import Cap from '../components/cloth/Cap.jsx';
import Top from '../components/cloth/Top.jsx';
import Bottom from '../components/cloth/Bottom.jsx';
import Shoes from '../components/cloth/Shoes.jsx';
import Outer from '../components/cloth/Outer.jsx';

const M_fashion = () => {
  const max_height = window.innerHeight-100

  const cap_height = max_height*0.25
  const top_height = max_height*0.25
  const bottom_height = max_height*0.25
  const shoes_height = max_height*0.25
  const outer_height = max_height*0

  return (
    <div className='center'>
      <div className='fashion_range' style={{
        height:max_height
        }}>
        <div className='fashion cap' style={{
          height:cap_height
        }}>
          <Cap className='fashion_item' style={{
            border: '1px solid black'
          }}/>
        </div>
        <div className='fashion top' style={{
          height:top_height
        }}>
          <Top className='fashion_item'/>
        </div>
        <div className='fashion bottom' style={{
          height:bottom_height
        }}>
          <Bottom className='fashion_item'/>
        </div>
        <div className='fashion shoes' style={{
          height:shoes_height
        }}>
          <Shoes className='fashion_item'/>
        </div>
        <div className='fashion outer' style={{
          height:outer_height
        }}>
          <Outer className='fashion_item'/>
        </div>
      </div>
    </div>
  )
}

export default M_fashion
